DROP TABLE IF EXISTS `useridentity`;


CREATE TABLE `useridentity` (
  `Id` varchar(128) NOT NULL,
  `Email` varchar(1000) DEFAULT NULL,
  `EmailConfirmed` tinyint(1) DEFAULT NULL,
  `PasswordHash` longtext,
  `SecurityStamp` longtext,
  `PhoneNumber` longtext,
  `PhoneNumberConfirmed` tinyint(1) DEFAULT NULL,
  `TwoFactorEnabled` tinyint(1) NOT NULL,
  `LockoutEndDateUtc` datetime DEFAULT NULL,
  `LockoutEnabled` tinyint(1) NOT NULL,
  `AccessFailedCount` int(11) NOT NULL,
  `UserName` varchar(1000) NOT NULL,
  `ResetPasswordToken` varchar(255) DEFAULT NULL,
  `DateLastConnection` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `EmailConfirmationToken` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `idx_useridentity_UserName` (`UserName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `userlogins`;


CREATE TABLE `userlogins` (
  `LoginProvider` varchar(128) NOT NULL,
  `ProviderKey` varchar(128) NOT NULL,
  `UserId` varchar(128) NOT NULL,
  PRIMARY KEY (`LoginProvider`,`ProviderKey`,`UserId`),
  KEY `ApplicationUser_Logins` (`UserId`),
  CONSTRAINT `ApplicationUser_Logins` FOREIGN KEY (`UserId`) REFERENCES `useridentity` (`Id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `userclaims`;


CREATE TABLE `userclaims` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `UserId` varchar(128) NOT NULL,
  `ClaimType` longtext,
  `ClaimValue` longtext,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `Id` (`Id`),
  KEY `UserId` (`UserId`),
  CONSTRAINT `ApplicationUser_Claims` FOREIGN KEY (`UserId`) REFERENCES `useridentity` (`Id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS `user`;


CREATE TABLE `user` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `FirstName` varchar(1000) NOT NULL,
  `LastName` varchar(1000) NOT NULL,
  `Description` varchar(5000) DEFAULT NULL,
  `CountryId` int(11) DEFAULT NULL,
  `DateOfBirth` date DEFAULT NULL,
  `Adress1` varchar(255) DEFAULT NULL,
  `Adress2` varchar(255) DEFAULT NULL,
  `Adress3` varchar(255) DEFAULT NULL,
  `DateCreation` datetime NOT NULL,
  `DateModification` datetime NOT NULL,
  `LanguageId` int(11) NOT NULL,
  `ProvinceId` int(11) DEFAULT NULL,
  `IsMasculine` bit(1) DEFAULT NULL,
  `FacebookId` varchar(100) DEFAULT NULL,
  `UserName` varchar(1000) NOT NULL,
  `PictureSrc` varchar(256) DEFAULT NULL,
  `ReceiveNews` bit(1) NOT NULL DEFAULT b'1',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `Id_UNIQUE` (`Id`),
  UNIQUE KEY `idx_user_UserName` (`UserName`),
  UNIQUE KEY `UC_User_FacebookId` (`FacebookId`),
  KEY `fk_user_country` (`CountryId`),
  KEY `FK_User_Language` (`LanguageId`),
  KEY `FK_User_Province` (`ProvinceId`),
  CONSTRAINT `FK_User_Language` FOREIGN KEY (`LanguageId`) REFERENCES `category` (`Id`),
  CONSTRAINT `FK_User_Province` FOREIGN KEY (`ProvinceId`) REFERENCES `province` (`Id`),
  CONSTRAINT `fk_user_country` FOREIGN KEY (`CountryId`) REFERENCES `country` (`Id`),
  CONSTRAINT `user_ibfk_1` FOREIGN KEY (`UserName`) REFERENCES `useridentity` (`UserName`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `log4net`;


CREATE TABLE `log4net` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Date` datetime DEFAULT NULL,
  `Thread` varchar(255) DEFAULT NULL,
  `Level` varchar(50) DEFAULT NULL,
  `Logger` varchar(5000) DEFAULT NULL,
  `Message` varchar(5000) DEFAULT NULL,
  `Exception` varchar(5000) DEFAULT NULL,
  `UserName` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `id_UNIQUE` (`Id`),
  KEY `UserName` (`UserName`),
  CONSTRAINT `log4net_ibfk_1` FOREIGN KEY (`UserName`) REFERENCES `user` (`UserName`)
) ENGINE=InnoDB AUTO_INCREMENT=580093 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `userrole`;



DROP TABLE IF EXISTS `userroles`;


CREATE TABLE `userroles` (
  `UserId` varchar(128) NOT NULL,
  `RoleId` varchar(128) NOT NULL,
  PRIMARY KEY (`UserId`,`RoleId`),
  KEY `IdentityRole_Users` (`RoleId`),
  CONSTRAINT `ApplicationUser_Roles` FOREIGN KEY (`UserId`) REFERENCES `useridentity` (`Id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `IdentityRole_Users` FOREIGN KEY (`RoleId`) REFERENCES `roles` (`Id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `tasklog`;

CREATE TABLE `tasklog` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `StartDate` datetime NOT NULL,
  `EndDate` datetime DEFAULT NULL,
  `Result` bit(1) DEFAULT NULL,
  `Comment` varchar(8000) DEFAULT NULL,
  `GroupName` varchar(100) DEFAULT NULL,
  `CallbackId` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `Id_UNIQUE` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `news`;

CREATE TABLE `news` (
  `Id` int(11) NOT NULL,
  `PublishDate` datetime NOT NULL,
  `CreationDate` datetime NOT NULL,
  `ModificationDate` datetime NOT NULL,
  `LastModificationUserId` int(11) DEFAULT NULL,
  `Title` varchar(100) NOT NULL,
  `Description` longtext NOT NULL,
  `MailSubject` varchar(100) DEFAULT NULL,
  `TypeId` int(11) NOT NULL,
  `TypeUserMailingId` int(11) DEFAULT NULL,
  `Active` bit(1) NOT NULL DEFAULT b'1',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `Id_UNIQUE` (`Id`),
  KEY `TypeId` (`TypeId`),
  KEY `TypeUserMailingId` (`TypeUserMailingId`),
  KEY `LastModificationUserId` (`LastModificationUserId`),
  CONSTRAINT `news_ibfk_1` FOREIGN KEY (`TypeId`) REFERENCES `category` (`Id`),
  CONSTRAINT `news_ibfk_2` FOREIGN KEY (`TypeUserMailingId`) REFERENCES `category` (`Id`),
  CONSTRAINT `news_ibfk_3` FOREIGN KEY (`LastModificationUserId`) REFERENCES `user` (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `scheduledtask`;

CREATE TABLE `scheduledtask` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `CallbackId` varchar(255) DEFAULT NULL,
  `UserId` int(11) DEFAULT NULL,
  `GroupName` varchar(100) NOT NULL,
  `CancellationDate` datetime DEFAULT NULL,
  `ExecutionDate` datetime DEFAULT NULL,
  `ExpectedExecutionDate` datetime NOT NULL,
  `EmailTypeId` int(11) DEFAULT NULL,
  `CreationDate` datetime NOT NULL,
  `NewsId` int(11) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `Id_UNIQUE` (`Id`),
  UNIQUE KEY `CallbackId_UNIQUE` (`CallbackId`),
  KEY `FK_scheduledtask_User` (`UserId`),
  KEY `FK_scheduledtask_EmailType` (`EmailTypeId`),
  KEY `NewsId` (`NewsId`),
  CONSTRAINT `FK_scheduledtask_EmailType` FOREIGN KEY (`EmailTypeId`) REFERENCES `category` (`Id`),
  CONSTRAINT `FK_scheduledtask_User` FOREIGN KEY (`UserId`) REFERENCES `user` (`Id`),
  CONSTRAINT `scheduledtask_ibfk_1` FOREIGN KEY (`NewsId`) REFERENCES `news` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=300 DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `emailtypelanguage`;

CREATE TABLE `emailtypelanguage` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `EMailTypeId` int(11) NOT NULL,
