  CONSTRAINT `FK_emailtypelanguage_Language` FOREIGN KEY (`LanguageId`) REFERENCES `category` (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;


